import React from "react";
import { useParams, useNavigate } from "react-router-dom";

function PdfViewer() {
  const { filename } = useParams();
  const navigate = useNavigate();

  return (
    <div style={{ height: "100vh", display: "flex", flexDirection: "column" }}>
      {/* Back button */}
      <button
        onClick={() => navigate(-1)}
        style={{
          background: "#fbbf24",
          border: "none",
          padding: "10px 20px",
          cursor: "pointer",
          fontWeight: "bold",
          margin: "10px",
          borderRadius: "8px",
        }}
      >
        â¬… Back
      </button>

      {/* PDF viewer */}
      <iframe
        src={`/pdfs/${filename}`}
        title="PDF Viewer"
        style={{ flex: 1, border: "none" }}
      />
    </div>
  );
}

export default PdfViewer;
